HMODULE opengl;

#define NAV_GET_GL_PROC_ADDRESS( procAddress) NavGetProcAddress( procAddress);

void* NavGetProcAddress( char* procAddres)
{
    void* ptr = GetProcAddress( opengl, procAddres);
    if( ptr == NULL)
    {
        ptr = wglGetProcAddress( procAddres);
    }

    return ptr;
}

